import React, { Component } from 'react';

class CycleA extends Component {
    render() {
        return (
            <ul>
                <div className='container'
                     style={{display: this.props.isToggle? 'block' : 'none'}}>
                    <div>40% Warmup Set 1 x 5 : {Math.round((this.props.weight-this.props.bar)*4/10).toFixed(1)}kg</div>
                    <div>50% Warmup Set 2 x 5 : {Math.round((this.props.weight-this.props.bar)*5/10).toFixed(1)}kg</div>
                    <div>60% Warmup Set 3 x 3 : {Math.round((this.props.weight-this.props.bar)*6/10).toFixed(1)}kg</div>
                </div>

                <div>65% Working Set 1 5x {Math.round((this.props.weight-this.props.bar)*65/100).toFixed(1)}kg</div>
                <div>75% Working Set 2 5x {Math.round((this.props.weight-this.props.bar)*75/100).toFixed(1)}kg</div>
                <div>85% Working Set 3 5x+ {Math.round((this.props.weight-this.props.bar)*85/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default CycleA;
